    public static String fileRead(String name) {
        JSONObject jsonObject = null;
        BufferedReader reader = null;
        String result = "";
        String temp = "";
        try {
            reader = new BufferedReader(new FileReader(fileAddress + name));

            while ((temp = reader.readLine()) != null){
                result += temp;
            }
            reader.close();
            /*@SuppressWarnings("unchecked")
            Object ob = new JSONParser().parse(new FileReader(fileAddress + name));
            jsonObject = (JSONObject) ob;*/

        } catch (Exception e) {
            e.getMessage();
        }
        return result;
    }

    public static String fileRead2(String name) {
        JSONObject jsonObject = null;
        try {
            Reader reader = new FileReader(fileAddress + name);

            JSONParser parser = new JSONParser();
            Object obj = parser.parse(reader);
            JSONArray jsonArray = (JSONArray) obj;

            for (int i = 0; i < jsonArray.size(); i++) {
                jsonObject = (JSONObject) jsonArray.get(i);
            }
        } catch (Exception e) {
            e.getMessage();
        }
        return "[" + jsonObject.toString() + "]";
    }

